      <div>
        <img className="UserPic" src={this.props.user[1]} alt="logo" />
      </div>
    );
    profile.push(<p className="username">{this.props.user[0]}</p>);
    profile.push(
      <p style={{ fontSize: 20 }}>Win rate: {this.props.winRate}</p>
    );

