    //   players.push(<p>{player}</p>)
    // });
    let length = this.props.playerLists.length;
    if (length % 2 === 0) {
      for (let i = 0; i < length; i += 2) {
        players.push(
          <Grid container direction="row" justify="space-evenly">
            <div>
              <img
                className="ProfilePic"
                src={this.props.playerLists[i][1]}
                alt="logo"
              />
              <p>{this.props.playerLists[i][0]}</p>
            </div>
            <div>
              <img
                className="ProfilePic"
                src={this.props.playerLists[i + 1][1]}
                alt="logo"
              />
              <p>{this.props.playerLists[i + 1][0]}</p>
            </div>
          </Grid>
        );
      }
    }

    this.setState({
      draftedPlayers: drafted,
      userProfile: profile,
      playerLists: players
    });
   */
  }

  componentDidMount() {
    this.initialize();
  }

  render() {
    let { draftedPlayers, userProfile, playerLists } = this.state;

    return (
      <Grid container direction="row" alignItems="stretch" justify="center">
        <div>
          <p>hi</p>
        </div>

        <div>
          <Grid container direction="row">
            <div style={{ textAlign: "center", color: "orangered" }}>
              <h1>Draft Players</h1>
              <div>
                {players.map(p => {
                  return (
                    <ExpansionPanel>
                      <ExpansionPanelSummary expandIcon={<ExpandMoreIcon />}>
                        <Avatar src={p.img} />

                        <Typography>{p.name} </Typography>
                      </ExpansionPanelSummary>
                      <ExpansionPanelDetails>
                        <Typography>
                          Lorem ipsum dolor sit amet, consectetur adipiscing
                          elit. Suspendisse malesuada lacus ex, sit amet blandit
                          leo lobortis eget.
                        </Typography>
                      </ExpansionPanelDetails>
                      <Divider />
                      <ExpansionPanelActions>
                        <Button size="small">Learn More</Button>
                        <Button
                          size="small"
                          color="primary"
                          variant="contained"
                        >
                          Draft
                        </Button>
                      </ExpansionPanelActions>
                    </ExpansionPanel>
                  );
                })}
              </div>
            </div>
            <div>
              <Grid container direction="row">
                <div className="DraftingPage">{userProfile}</div>
                <div className="Playerlist">{draftedPlayers}</div>
              </Grid>
            </div>
          </Grid>
        </div>

        <div>
          <Grid container direction="row">
            <div style={{ textAlign: "center" }}>
              <h1>Your Players</h1>
              <Card>
                <CardContent>
                  <Typography
                    className={classes.title}
                    color="textSecondary"
                    gutterBottom
                  >
                    Word of the Day
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button size="small">Learn More</Button>
                </CardActions>
              </Card>
            </div>
          </Grid>
        </div>
      </Grid>
    );
  }
}

export default DraftingPage;
